import React from 'react'
import cookiesData from '../CookiesData.js'

export default function Cookies() {
    return (
              <div style={styles.cookie}>
                <img style={styles.cookieImage} alt={cookiesData.name} src={cookiesData.image} />
                <p style={styles.text}>{cookiesData.name}</p>
                <p style={styles.text}>{cookiesData.price} KD</p>
              </div>
    )
}
